import{_ as s,o,c as t,z as e,a}from"./chunks/framework.9482e208.js";const y=JSON.parse('{"title":"§ 28.2-551 Surveys and reports as conclusive evidence.","description":"","frontmatter":{},"headers":[],"relativePath":"vacode/28.2-551.md","filePath":"vacode/28.2-551.md"}'),r={name:"vacode/28.2-551.md"},n=e("h1",{id:"§-28-2-551-surveys-and-reports-as-conclusive-evidence",tabindex:"-1"},[a("§ 28.2-551 Surveys and reports as conclusive evidence. "),e("a",{class:"header-anchor",href:"#§-28-2-551-surveys-and-reports-as-conclusive-evidence","aria-label":'Permalink to "§ 28.2-551 Surveys and reports as conclusive evidence."'},"​")],-1),c=e("p",null,"The surveys of the natural oyster beds, rocks, and shoals of the Commonwealth, made pursuant to Chapter 511 of the 1892 Acts of Assembly, shall continue to be the surveys defining and determining the natural oyster beds, rocks, and shoals of the Commonwealth. The surveys and reports filed in accordance with this Act of Assembly are conclusive evidence of the boundaries and limits of all the natural oyster beds, rocks, and shoals and that there are no other public oyster beds, rocks, or shoals. The surveys of the public oyster beds, rocks, or shoals of the Commonwealth referred to in this section shall not extend inshore of the mean low-water mark of such body of water, notwithstanding any surveys, plats, markers, or lines to the contrary.",-1),d=e("p",null,"Code 1950, § 28-117; 1962, c. 406, § 28.1-100; 1964, c. 624; 1992, c. 836.",-1),i=[n,c,d];function l(h,u,v,f,m,p){return o(),t("div",null,i)}const b=s(r,[["render",l]]);export{y as __pageData,b as default};
